import React from "react";
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as IoIcons from 'react-icons/io';
import * as MdIcons from 'react-icons/md';
import * as BsIcons from 'react-icons/bs';
import * as GoIcons from 'react-icons/go';
import * as BiIcons from 'react-icons/bi';
import * as RiIcons from 'react-icons/ri'

export const SidebarData = [
    {
        heading : "Tableau de bord",
        icon:<RiIcons.RiDashboardFill style={{width:"25px", height:"25px", color:'#200752'}}/>
    },
    {
        heading : "Nouvelle Demande",
        icon:<AiIcons.AiFillFileAdd style={{width:"25px", height:"25px", color:'#200752'}}/>,
        number:null
    },
    {
        heading : "En Verification", 
        icon:<AiIcons.AiOutlineFileSync style={{width:"25px", height:"25px", color:'#200752'}}/>,
        number:0


    },
    {
        heading : "À completer",
        icon:<RiIcons.RiFileChart2Fill style={{width:"25px", height:"25px", color:'#200752'}}/>,
        number:0

    },
    {
        heading : "Dossier Traités",
        icon:<AiIcons.AiOutlineFileDone style={{width:"25px", height:"25px", color:'#200752'}}/>,
        number:0
    },
    {
        heading : "Refusés",
        icon:<AiIcons.AiFillFileExcel style={{width:"25px", height:"25px", color:'#200752'}}/>,
        number:0
    },
    {
        heading : "Liste des clients",
        icon:<FaIcons.FaUsers style={{width:"25px", height:"25px", color:'#200752'}}/>,
        number:null
    },
    {
        heading : "Rapport",
        icon:<AiIcons.AiOutlineFileProtect style={{width:"25px", height:"25px", color:'#200752'}}/>,
        number:null
    },
    {
        heading : "Revenus",
        icon:<RiIcons.RiMoneyEuroCircleFill style={{width:"25px", height:"25px", color:'#200752'}}/>,
        number:null
    },

]
